  const {cart} = useSelector((state)=> state);

  return (
<div>
    {
cart.length > 0 ?
(<div>
{
  cart.map((item,index)=>{
    return <CartItem key={item.id}  Cartindex={index}   />
  })
}
</div>):
(
  <div>
  <h2>No Item </h2>
  <NavLink to="/" >
  <button>Shop Now</button>
  </NavLink>
  </div>
)
    }
  </div>
  );
};

export default Cart;
